$(document).ready(function(){
$('#sub').click(function(){


        $.post("/getdetails").done(function(data, textStatus, jqXHR) 
        {
                alert(JSON.stringify(data));
                columns = [
           
            {title: "StaffName", dataKey: "StaffName"}, 
            {title: "MobileNo", dataKey: "MobileNo"},
            {title: "StaffCode", dataKey: "StaffCode"},
            {title: "Email", dataKey: "Email"},
        ];
            var rows = data;
        var doc = new jsPDF('p', 'pt');
        //doc.addImage('adityalogo.png', 'png', 15, 40, 180, 160);
        var imgData = 'data:image/png;base64,';

        var myhub='data:image/png;base64,';
        doc.addImage(imgData, 'JPEG', 15, 15, 100, 60);
        doc.addImage(myhub,'png',480,15,100,60);
        doc.setFontSize(14);
        doc.text(130,55,"ADITYA GROUP OF EDUCATIONAL INISTITUTIONS");
        doc.autoTable(columns, rows,{theme:'grid',showHeader: 'everyPage',startY:160,headerStyles: {fillColor: 20},alternateRowStyles: {fillColor:200}});
        doc.output('save', 'filename.pdf');
        doc.printout();






        }).fail(function(jqXHR, textStatus, errorThrown) 
        {
            alert('network connection busy try again');
        });




     
});
   

});
